import Home from "./pages/Home";
import Navbar from "./components/Navbar"
import signup from "./components/signup"

import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

const App = () => {

    return (
        <div>

        <Router>
        {<Navbar />}
        <Routes>

          <Route path="/" element={<Home />} />
          <Route path="/signup" element={<signup />} />
        </Routes>
        </Router>
      </div>

    );
};

export default App;
